TS_research_enabled=При включении этой опции вы должны исследовать щиты, а не получаете их бесплатно\Вы можете включить\выключить это.
TS_research_size= В исследовании пропускной способности щита - количество шагов теперь значительно больше (100 - [5] - 1).
