TS_energy_consumption=Для зарядки щитов теперь требуется электричество.
TS_energy_consumption_multiplier=Здесь вы можете установить множитель для стоимости энергии за точку попадания. 1 = 1 кДж/точка попадания. \n(0.01 - [25.00] - 100.0)
