TS_power_drain=Пассивный расход электроэнергии. (0.1 - [20] - 50)
TS_max_research_level=Помогает устранить сбои при запуске из-за "Достигнутого предела идентификатора для сущностей". Значение 100 здесь означает, что будет создано 100^2 или 10 000 объектов. Factorio имеет ограничение в 65536 сущностей. (5 - [25] - 100)

